import React from "react";
import Markdown from "markdown-to-jsx";
import { Box, BoxItem, List, ListItem, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';


const Contact = () => {

    const useStyles = makeStyles({
        thisList: {
            padding: "0",
            margin: "0"
        },
        mainDiv: {
            margin: "40px"
        }
      })
      
      const classes = useStyles();
    return (
    <div className={classes.mainDiv}>
        <h2>Kontaktuppgifter</h2>




            <List className={classes.thisList}>
                <ListItem >
                Mail: fredrik.fischer@protonmail.com
                </ListItem>
                <ListItem>
                RSS: fredrikfischer.se/RSS
                
                </ListItem>
                <ListItem>
                Github: https://github.com/fredrikfischer
                </ListItem>
            </List>
    </div>
    )
    
}

export {Contact}
